import React, { Component } from 'react'
import {View, Button, Text} from 'react-native'

import firebase from 'firebase'
require("firebase/firestore")

export class homePage extends Component {

    constructor(props){
        super(props);
        this.state={
            post: []
        }
    }


    componentDidMount(){
        let post = []
        firebase.firestore()
            .collection('posts')
            .doc(firebase.auth().currentUser.uid)
            .collection("userPosts")
            .orderBy("date","asc")
            .get()
            .then((infos)=>{
                let posts = infos.docs.map(doc => {
                    post.push(doc)
                })
                console.log("date post1: " +this.post[0].date)
                console.log("date post2: " +this.post[1].date)
            })
    }


    render() {
        return (
            <View>
                <Text>Welcome to your profile {this.props.route.params.res} </Text>                
                <Button title="Add Picture" onPress={()=> {this.props.navigation.navigate('addPicture')}}/>
                <Button title="Log Out" onPress={()=> {this.props.navigation.navigate('Logout')}} />
            </View>
            )
    }
}

export default homePage
